import React, { useState } from 'react'

const PicApi = () => {
    const [images, setImages]= useState([])
    const getData = async ()=>{
        const res = await axios.get("https://picsum.photos/v2/list") 
        const data = res.data
        console.log(data)
        setImages(data)
    }
  return (
    <div>
      <button onClick={getData} style={{fontSize:"21px", padding:"10px 20px", margin:"10px", borderRadius:"7px", color:"black", border:"none", background:"grey"}}>Click</button>
      
    </div>
  )
}

